43X)"]},{"cell_type":"markdown","id":"0a2100e2","metadata":{"papermill":{"duration":0.008947,"end_time":"2024-02-07T11:58:02.188018","exception":false,"start_time":"2024-02-07T11:58:02.179071","status":"completed"},"tags":[]},"source":["# Sentiments"]},{"cell_type":"markdown","id":"c17ae454","metadata":{"papermill":{"duration":0.008877,"end_time":"2024-02-07T11:58:02.206871","exception":false,"start_time":"2024-02-07T11:58:02.197994","status":"completed"},"tags":[]},"source":["## We can retrieve these lexicons using the get_sentiments() function. We can implement this as follows:"]},{"cell_type":"code","execution_count":4,"id":"c03e33a6","metadata":{"execution":{"iopub.execute_input":"2024-02-07T11:58:02.229055Z","iopub.status.busy":"2024-02-07T11:58:02.227064Z","iopub.status.idle":"2024-02-07T11:58:02.303803Z","shell.execute_reply":"2024-02-07T11:58:02.301321Z"},"papermill":{"duration":0.090939,"end_time":"2024-02-07T11:58:02.30683","exception":false,"start_time":"2024-02-07T11:58:02.215891","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6786 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>word</th><th scope=col>sentiment</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>2-faces      </td><td>negative</td></tr>\n","\t<tr><td>abnormal     </td><td>negative</td></tr>\n","\t<tr><td>abolish      </td><td>negative</td></tr>\n","\t<tr><td>abominable   </td><td>negative</td></tr>\n","\t<tr><td>abominably   </td><td>negative</td></tr>\n","\t<tr><td>abominate    </td><td>negative</td></tr>\n","\t<tr><td>abomination  </td><td>negative</td></tr>\n","\t<tr><td>abort        </td><td>negative</td></tr>\n","\t<tr><td>aborted      </td><td>negative</td></tr>\n","\t<tr><td>aborts       </td><td>negative</td></tr>\n","\t<tr><td>abound       </td><td>positive</td></tr>\n","\t<tr><td>abounds      </td><td>positive</td></tr>\n","\t<tr><td>a